import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";

// Note, tasks within checklists are un-related to standalone tasks module

const CompletedTaskList = props => {
  const { completedTasks } = props;

  return (
    <table className="table">
      <thead>
        <tr>
          <th />
          <th>Title</th>
          <th>Body</th>
          <th>Category</th>
          <th>Time of Completion</th>
          <th />
        </tr>
      </thead>
      <tbody>
        {completedTasks.map(checklist => {
          return (
            <tr key={checklist.id}>
              <td></td>
              <td>
                <Link to={"/checklist/view/" + checklist.slug}>
                  {checklist.title}
                </Link>
              </td>
              <td>
                {checklist.tasks.slice(0, 3).map(task => {
                  return (
                    <ul key={task.title}>
                      <li>{task.title}</li>
                    </ul>
                  );
                })}
              </td>
              <td>
                {checklist.tasks.slice(0, 3).map(task => {
                  return (
                    <ul style={{ listStyleType: "none" }} key={task.title}>
                      <li>{task.category}</li>
                    </ul>
                  );
                })}
              </td>

              <td></td>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

CompletedTaskList.propTypes = {
  completedTasks: PropTypes.array.isRequired
};

export default CompletedTaskList;
